def gcd(a, b):
    if b == 0:
        return a
    return gcd(b, a % b)

def lcm(a, b):
    return a * b // gcd(a, b)

def find_factors(n):
    factors = []
    for i in range(1, n + 1):
        if n % i == 0:
            factors.append(i)
    return factors

def main():
    n = int(input())
    a = list(map(int, input().split()))

    smallest_num = a[0]
    for i in range(1, n):
        smallest_num = lcm(smallest_num, a[i])

    print(len(find_factors(smallest_num)))

main()

from sys import stdin
from math import gcd

def solve(a):
    n = len(a)
    g = a[0]
    for i in range(1, n):
        g = gcd(g, a[i])
    return len(list(divisors(g)))

def divisors(n):
    i = 1
    while i * i <= n:
        if n % i == 0:
            yield i
            if n // i != i:
                yield n // i
        i += 1

def main():
    n = int(stdin.readline())
    a = list(map(int, stdin.readline().split()))
    print(solve(a))

